For now only a key-value store is supported for persistent storage. Eventually, additional facilities may be added: a cyclic logging journal, a file-system, raw flash access, etc. In this section, we will illustrate the key-value store usage by walking through the store example which provides direct store access with a text-based interface through the platform protocol applet RPC mechanism. The key-value store has 2 restrictions: Keys must be between 0 and 4095 Values must be at most 1023 bytes The second restriction can be worked around by storing large entries as multiple fragments of at most 1023 bytes each using multiple keys. To support those large entries, we define an abstract notion of keys. An abstract key is either exactly one key, or a contiguous range of keys. enum Key { Exact(usize), Range(Range<usize>),
} The store provides 3 operations: insert, find, and remove. Each of those operation comes with a fragmented variant (working on a range of keys for large values). We define helpers to dispatch to the regular or fragmented version based on the abstract key. fn insert(key: &Key, value: &[u8]) -> Result<(), Error> { match key { Key::Exact(key) => store::insert(*key, value), Key::Range(keys) => store::fragment::insert(keys.clone(), value), }
} fn find(key: &Key) -> Result<Option<Box<[u8]>>, Error> { match key { Key::Exact(key) => store::find(*key), Key::Range(keys) => store::fragment::find(keys.clone()), }
} fn remove(key: &Key) -> Result<(), Error> { match key { Key::Exact(key) => store::remove(*key), Key::Range(keys) => store::fragment::remove(keys.clone()), }
